/*Table structure for table `stats` */

DROP TABLE IF EXISTS `stats`;

CREATE TABLE `stats` (
  `versionId` char(6) NOT NULL DEFAULT 'FIFA14',
  `teamId` varchar(5) NOT NULL,
  `countryId` varchar(5) NOT NULL,
  `playerName` varchar(20) NOT NULL,
  `gameDateTime` datetime NOT NULL,
  `myTeamId` char(4) NOT NULL DEFAULT 'CPFC',
  `gameType` char(1) NOT NULL,
  `homeAway` char(1) NOT NULL DEFAULT 'H',
  `division` tinyint(1) unsigned DEFAULT NULL,
  `matchAbandoned` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `extraTime` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `goalsFor` tinyint(1) unsigned zerofill NOT NULL DEFAULT '0',
  `goalsAgainst` tinyint(1) unsigned zerofill NOT NULL DEFAULT '0',
  `penaltiesFor` tinyint(1) unsigned zerofill DEFAULT '0',
  `penaltiesAgainst` tinyint(1) unsigned zerofill DEFAULT '0',
  `possessionPercentage` tinyint(3) unsigned NOT NULL DEFAULT '50',
  `shots` tinyint(2) unsigned zerofill NOT NULL DEFAULT '00',
  `shotsOnTarget` tinyint(2) unsigned zerofill NOT NULL DEFAULT '00',
