/*Table structure for table `team` */

DROP TABLE IF EXISTS `team`;

CREATE TABLE `team` (
  `teamId` varchar(5) NOT NULL,
  `countryId` varchar(5) NOT NULL,
  `teamName` varchar(100) NOT NULL,
  `teamComments` tinytext,
  `logoImage` varchar(150) NOT NULL,
  PRIMARY KEY (`teamId`,`countryId`),
  KEY `countryId` (`countryId`),
  KEY `countryId-FK` (`countryId`),
  CONSTRAINT `countryId-FK` FOREIGN KEY (`countryId`) REFERENCES `country` (`countryId`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

