  DECLARE iGameComments TINYTEXT ;
  -- this cursor returns all stats rows from the old DB.
  DECLARE cStatsIterator CURSOR FOR 
  SELECT 
    versionId,
    teamId,
    playerName,
    myTeamId,
    gameType,
    gameDateTime,
    homeAway,
    division,
    matchAbandoned,
    extraTime,
    goalsFor,
    goalsAgainst,
    gameComments 
  FROM
    fifa.`stats` ;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET iDone = 1 ;
  -- Step 01: 
  SET iDone = 0 ;
  OPEN cStatsIterator ;
  lStatsIterator :
  LOOP
    FETCH cStatsIterator INTO iVersionId,
    iTeamId,
    iPlayerName,
    iMyTeamId,
    iGameType,
    iGameDateTime,
    iHomeAway,
    iDivision,
    iMatchAbandoned,
    iExtraTime,
    iGoalsFor,
    iGoalsAgainst,
    iGameComments ;
    IF 1 = iDone 
    THEN LEAVE lStatsIterator ;
    END IF ;
    SELECT 
      countryId into iCountryId 
    from
      fifadev.`team` 
    where teamId = iTeamId ;
    IF iCountryId IS NOT NULL 
    THEN 
    INSERT INTO fifadev.`stats` (
      `versionId`,
      `teamId`,
      `countryId`,
      `playerName`,
      `myTeamId`,
      `gameType`,
      `gameDateTime`,
      `homeAway`,
      `division`,
      `matchAbandoned`,
      `extraTime`,
      `goalsFor`,
      `goalsAgainst`,
      `gameComments`
    ) 
    VALUES
      (
        iVersionId,
        iTeamId,
        iCountryId,
        iPlayerName,
        iMyTeamId,
        iGameType,
        iGameDateTime,
        iHomeAway,
        iDivision,
        iMatchAbandoned,
        iExtraTime,
        iGoalsFor,
        iGoalsAgainst,
        iGameComments
      ) ;
    END IF ;
  END LOOP lStatsIterator ;
  CLOSE cStatsIterator ;
END */$$
